import React, { Component } from 'react'
import "./home.css"
import BGImg from "../assets/colorful-powder-explosion-white-background_44314-3537.jpg";

export default class Home extends Component {
    sectionStyle = {
        width: "100%",
        height: "400px",
        backgroundImage: `url(${ BGImg }")`
      };

  render() {
    return (
      <div style={sectionStyle} id="home2" className='home'>
        <div className='p-5 bg-secondary text-white opacity-25'><div>TRY GLASSESS APP ONLINE</div></div>
        <img src={BGImg} alt="" />
      </div>
    )
  }
}
